import { StaticDateTimePicker } from "@mui/lab";
import { Button } from "@mui/material";
import { useSelector } from "react-redux";
import { useNavigate } from "react-router-dom";

const ErrorPage = () => {
  const navigate = useNavigate();
  const {user} = useSelector((state)=>state.user)
  const handleClick = () =>{
    if(localStorage.getItem('access-token')||sessionStorage.getItem('access-token') || user){
      navigate('/dashboard') 
    }
    else{
    navigate('/')
    }
  }
  return (
    <>
     <Button onClick={handleClick}>Back To Main Page</Button>
      <h1 className="error_msg">Page Not Found 404 !</h1>
  </>
  )
};
export default ErrorPage;
